import logo from './logo.svg';
import { Player } from 'video-react';
import './App.css';

function App() {
  return (
    <div className="App">
      <Player
        muted={true}
        autoPlay={true}
        playsInline
        poster="/assets/poster.png"
        src="https://media.w3.org/2010/05/sintel/trailer_hd.mp4"
      />
    </div>
  );
}

export default App;
